/*Table structure for table `tblcrmemail` */

DROP TABLE IF EXISTS `tblcrmemail`;

CREATE TABLE `tblcrmemail` (
  `emailno` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `emailto` varchar(1000) NOT NULL,
  `emailfrom` varchar(250) NOT NULL,
  `emailsubject` varchar(250) NOT NULL,
  `emailbody` text NOT NULL,
  `createddate` datetime DEFAULT NULL,
  `sentdate` datetime DEFAULT NULL,
  `brid` varchar(50) DEFAULT NULL,
  `notes` varchar(1000) DEFAULT NULL,
  `status` varchar(15) DEFAULT NULL,
  `incidentid` varchar(15) DEFAULT NULL,
  `refid` varchar(50) DEFAULT NULL,
  `trycount` smallint(5) unsigned DEFAULT NULL,
  PRIMARY KEY (`emailno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tblcrmemail` */

/*Table structure for table `tblcrmemailmattach` */

DROP TABLE IF EXISTS `tblcrmemailmattach`;

CREATE TABLE `tblcrmemailmattach` (
  `attid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `attfilename` varchar(255) NOT NULL,
  `attdatetime` varchar(45) NOT NULL,
  `emailid` int(10) unsigned DEFAULT NULL,
  `atttype` varchar(255) DEFAULT NULL,
  `session` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`attid`)
) ENGINE=InnoDB AUTO_INCREMENT=976 DEFAULT CHARSET=utf8;

