/*Table structure for table `tblcrmemailmonitor` */

DROP TABLE IF EXISTS `tblcrmemailmonitor`;

CREATE TABLE `tblcrmemailmonitor` (
  `emailid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `emailfrom` varchar(200) DEFAULT NULL,
  `emailto` varchar(1000) DEFAULT NULL,
  `emailsubject` varchar(1000) DEFAULT NULL,
  `emailbody` longtext,
  `receiveddate` datetime DEFAULT NULL,
  `status` varchar(10) DEFAULT NULL,
  `lastupdate` datetime DEFAULT NULL,
  `updateby` varchar(50) DEFAULT NULL,
  `remarks` text,
  `incidentno` varchar(15) DEFAULT NULL,
  `theemail` longtext,
  `bodyhtml` longtext,
  `emailtype` varchar(45) DEFAULT NULL,
  `attcount` int(10) unsigned DEFAULT NULL,
  `trycount` smallint(5) unsigned DEFAULT '0',
  `uid` varchar(99) DEFAULT NULL,
  `emailcc` varchar(1000) DEFAULT NULL,
  `emailbcc` varchar(1000) DEFAULT NULL,
  `emailtorecipient` varchar(1000) DEFAULT NULL,
  `ischeck` tinyint(1) DEFAULT NULL,
  `assignedto` varchar(15) DEFAULT NULL,
  `assigneddt` datetime DEFAULT NULL,
  PRIMARY KEY (`emailid`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

