/*Table structure for table `tblcrmreportscheduler` */

DROP TABLE IF EXISTS `tblcrmreportscheduler`;

CREATE TABLE `tblcrmreportscheduler` (
  `reportid` varchar(15) NOT NULL,
  `reporttitle` varchar(50) DEFAULT NULL,
  `filename` varchar(50) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `nextrundate` datetime DEFAULT NULL,
  `nextruntime` varchar(5) DEFAULT NULL,
  `prevrundate` datetime DEFAULT NULL,
  `prevruntime` varchar(5) DEFAULT NULL,
  `runevery` int(10) DEFAULT NULL,
  `runtype` varchar(10) DEFAULT NULL,
  `desttype` varchar(50) DEFAULT NULL,
  `destdesc` varchar(50) DEFAULT NULL,
  `format` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`reportid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tblcrmreportscheduler` */

/*Table structure for table `tblcrmsmsmonitor` */

