  `incidentno` varchar(15) DEFAULT NULL,
  `thesms` longtext,
  `emailto` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`smsid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tblcrmsmsmonitor` */

/*Table structure for table `tblcti` */

