  `status` tinyint(1) NOT NULL,
  `refid` varchar(45) DEFAULT NULL,
  `source` varchar(45) DEFAULT NULL,
  `uid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`rid`)
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8;

