  `SubscriberLastName` varchar(100) DEFAULT NULL,
  `SubscriberBirthDate` datetime DEFAULT NULL,
  `SubscriberBirthPlace` varchar(100) DEFAULT NULL,
  `SubscriberAddress` varchar(255) DEFAULT NULL,
  `SubscriberCity` varchar(100) DEFAULT NULL,
  `SubscriberDistrict` varchar(100) DEFAULT NULL,
