  `SubscriberIdentityQuestion1` varchar(100) DEFAULT NULL,
  `SubscriberIdentityAnswer1` varchar(255) DEFAULT NULL,
  `SubscriberIdentityQuestion2` varchar(100) DEFAULT NULL,
