/*Table structure for table `tbldigitalmessaging` */

DROP TABLE IF EXISTS `tbldigitalmessaging`;

CREATE TABLE `tbldigitalmessaging` (
  `dmid` varchar(20) NOT NULL,
  `dmpost` datetime DEFAULT NULL,
  `dmto` varchar(15) DEFAULT NULL,
  `dmfrom` varchar(15) DEFAULT NULL,
  `dmstatus` varchar(15) DEFAULT NULL,
  `dmstop` datetime DEFAULT NULL,
  `dmmessage` varchar(255) DEFAULT NULL,
  `subincidentid1` varchar(15) DEFAULT NULL,
  `subincidentid2` varchar(15) DEFAULT NULL,
  `subincidentid3` varchar(15) DEFAULT NULL,
  `priorityid` varchar(15) DEFAULT NULL,
  `impactid` varchar(15) DEFAULT NULL,
  `enquirytypeid` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`dmid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

