/*Data for the table `tblemailcann` */

insert  into `tblemailcann`(`cannid`,`canndesc`,`templateid`,`responsetext`) values ('0000001','Product','0000001','Dear [Customer_Name], \r\n<br><br>\r\nBased on your previous email request, we would like to introduce our local product to you. We have attached the product brochure in which it explains products details by category together with pricing structure. We also can customized our product to fulfil your business needs. Please go to our corporate website if you required more information. \r\n<br><br>\r\nThanks<br>\r\nSales Department<br><br>\r\n');
insert  into `tblemailcann`(`cannid`,`canndesc`,`templateid`,`responsetext`) values ('0000002','Promotion','0000001','Dear [Customer_Name], \r\n<br><br>\r\nOur company is currently running a promotion starting from today and it will end by 28th Feb 2018. All the purchases will be entitled additional 10% in reduction together with 2x loyalty points being rewarded for each purchase. For more details, please visit our website. \r\n<br><br>\r\nThanks<br>\r\nSales Department<br><br>\r\n');
insert  into `tblemailcann`(`cannid`,`canndesc`,`templateid`,`responsetext`) values ('0000003','Payment Cancellation','0000001','Dear [Customer_Name], \r\n<br><br>\r\nWe are regretted to know that you requested to activate cancellation process. In order for our finance department to proceed with the cancellation, we need to have the following information: <br>\r\n•	Transaction details <br>\r\n•	Proof of payment <br>\r\n•	Payment channel<br>\r\n•	Any other supporting documents. <br>\r\n<br>\r\nWe hope to serve you better in the near future. <br>\r\n<br>\r\nThanks<br>\r\nSales Department<br>\r\n');
insert  into `tblemailcann`(`cannid`,`canndesc`,`templateid`,`responsetext`) values ('0000004','Delivery','0000002','Dear [Customer_Name], <br>\r\n<br>\r\nThank you very much for being our customer. We would like to schedule a delivery to you. Can you please tell us when will it be convenient for our logistic department to give you a call  pertaining on the delivery?<br>\r\n<br>\r\nThanks<br>\r\nSales Department<br>\r\n');
insert  into `tblemailcann`(`cannid`,`canndesc`,`templateid`,`responsetext`) values ('0000005','Warranty','0000002','Dear [Customer_Name], <br>\r\n<br>\r\nIn order to claim for warranty on the purchased product, our operation department will need the following documents prior to process the warrarnty. <br>\r\n<br>\r\n•	Delivery order<br>\r\n•	Warranty card<br>\r\n•	Any other supporting documents. <br>\r\n<br>\r\nThanks<br>\r\nSales Department<br>\r\n');

