/*Table structure for table `tblincidentinfo` */

DROP TABLE IF EXISTS `tblincidentinfo`;

CREATE TABLE `tblincidentinfo` (
  `inclidentid` varchar(15) NOT NULL,
  `customerid` varchar(15) DEFAULT NULL,
  `agentid` varchar(20) DEFAULT NULL,
  `subincident1` varchar(15) DEFAULT NULL,
  `subincident2` varchar(15) DEFAULT NULL,
  `subincident3` varchar(15) DEFAULT NULL,
  `channeltypeid` varchar(15) DEFAULT NULL,
  `subincident4` varchar(15) DEFAULT NULL COMMENT 'tblenquirytype',
  `priority` varchar(15) DEFAULT NULL,
  `status` varchar(15) DEFAULT NULL,
  `reportdatetime` datetime DEFAULT NULL,
  `duedatetime` datetime DEFAULT NULL,
  `responsedatetime` datetime DEFAULT NULL,
  `levelid` varchar(15) DEFAULT NULL,
  `departmentid` varchar(15) DEFAULT NULL,
  `incidentdesc` text,
  `incidentres` text,
  `remarks` text,
  `lastupdate` datetime DEFAULT NULL,
  `mainincidentid` varchar(15) DEFAULT NULL,
  `serviceagreementid` varchar(15) DEFAULT NULL,
  `assigneedepartment` varchar(50) DEFAULT NULL,
  `customertype` varchar(50) DEFAULT NULL,
  `impact` varchar(50) DEFAULT NULL,
  `followupdate` datetime DEFAULT NULL,
  `followupremarks` text,
  `levelfrom` varchar(50) DEFAULT '0000001',
  `mailboxsource` varchar(255) DEFAULT NULL,
  `emailfrom` varchar(255) DEFAULT NULL,
  `createdby` varchar(20) DEFAULT NULL,
  `acknowledgedby` varchar(15) DEFAULT NULL,
  `acknowledgeddt` datetime DEFAULT NULL,
  `wholeemail` text,
  `emailuid` varchar(255) DEFAULT NULL,
  `aginginmin` int(10) unsigned DEFAULT NULL,
  `emailid` int(10) unsigned DEFAULT NULL,
  `utcount` int(10) unsigned DEFAULT NULL,
  `nextactionid` varchar(15) DEFAULT NULL,
  `nextactiondate` datetime DEFAULT NULL,
  `checklist` varchar(15) DEFAULT NULL,
  `caller` varchar(255) DEFAULT NULL,
  `callerno` varchar(255) DEFAULT NULL,
  `contractno` varchar(45) DEFAULT NULL,
  `assetid` varchar(45) DEFAULT NULL,
  `channelid` varchar(15) DEFAULT NULL,
  `sourceid` varchar(15) DEFAULT NULL,
  `completeddate` datetime DEFAULT NULL,
  `actualresponsedate` datetime DEFAULT NULL,
  `dockettypeid` varchar(15) DEFAULT NULL,
  `countryid` varchar(15) DEFAULT NULL,
  `vendorticketno` varchar(45) DEFAULT NULL,
  `resolutionslacode` varchar(15) DEFAULT NULL,
  `responseslacode` varchar(15) DEFAULT NULL,
  `assignedto` varchar(15) DEFAULT NULL,
  `duplicated` tinyint(3) unsigned DEFAULT NULL,
  `jobsheetno` varchar(45) DEFAULT NULL,
  `incomingphoneno` varchar(45) DEFAULT NULL,
  `shortdesc` varchar(255) DEFAULT NULL,
  `assigndt` datetime DEFAULT NULL,
  `acceptdt` datetime DEFAULT NULL,
  `wipdt` datetime DEFAULT NULL,
  `suspenddt` datetime DEFAULT NULL,
  `solvedt` datetime DEFAULT NULL,
  `closedt` datetime DEFAULT NULL,
  `jobsheetlocation` varchar(15) DEFAULT NULL,
  `ResolutionCodeID` varchar(15) DEFAULT NULL,
  `suspendreasonid` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`inclidentid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

