/*Table structure for table `tblsubincidentmatrix` */

DROP TABLE IF EXISTS `tblsubincidentmatrix`;

CREATE TABLE `tblsubincidentmatrix` (
  `matrixid` varchar(30) NOT NULL,
  `matrixdesc` varchar(255) DEFAULT NULL,
  `incidenttype` varchar(15) DEFAULT NULL,
  `enquirytypeid` varchar(15) DEFAULT NULL,
  `subincident2id` varchar(15) DEFAULT NULL,
  `subincident3id` varchar(15) DEFAULT NULL,
  `isactive` tinyint(1) unsigned DEFAULT '1' COMMENT '0 = Inactive; 1 = Active',
  `creuserid` varchar(15) DEFAULT NULL,
  `credatetime` datetime DEFAULT NULL,
  `upduserid` varchar(15) DEFAULT NULL,
  `upddatetime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `errorcode` varchar(100) DEFAULT NULL,
  `resolution` text,
  `checklistid` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`matrixid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

