/*Table structure for table `tbluser` */

DROP TABLE IF EXISTS `tbluser`;

CREATE TABLE `tbluser` (
  `userid` varchar(20) NOT NULL DEFAULT '1',
  `password` varchar(15) DEFAULT NULL,
  `role` varchar(15) DEFAULT NULL COMMENT 'flagship,tblrole',
  `userfirstname` varchar(50) DEFAULT NULL,
  `userlastname` varchar(50) DEFAULT NULL,
  `designation` varchar(50) DEFAULT NULL,
  `departmentid` varchar(50) DEFAULT NULL,
  `mobileno` varchar(15) DEFAULT NULL,
  `phoneno` varchar(15) DEFAULT NULL,
  `ext` varchar(15) DEFAULT NULL,
  `faxno` varchar(15) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `levelid` varchar(15) DEFAULT NULL COMMENT 'incidentlevel-id',
  `supervisor` varchar(30) DEFAULT NULL,
  `attempcount` int(10) unsigned DEFAULT '0',
  `lastattemp` datetime DEFAULT NULL,
  `locked` char(1) DEFAULT NULL,
  `createdby` varchar(15) DEFAULT NULL,
  `createdate` varchar(50) DEFAULT NULL,
  `groupid` varchar(15) DEFAULT NULL,
  `countryid` varchar(15) DEFAULT NULL,
  `ctiid` varchar(45) DEFAULT NULL,
  `lastlogin` datetime DEFAULT NULL,
  `lastonline` datetime DEFAULT NULL,
