/* Procedure structure for procedure `sp_dhbProjectManager` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_dhbProjectManager` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_dhbProjectManager`()
BEGIN
	
	DECLARE v_Parent_walker VARCHAR(50) DEFAULT '';
	DECLARE v_ParentStart_walker DATETIME;
	DECLARE v_ParentEnd_walker DATETIME;
	DECLARE v_ParentID_walker int DEFAULT 0;
	DECLARE v_RecordID_walker INT DEFAULT 0;
	DECLARE v_Child_walker VARCHAR(50) DEFAULT '';
	DECLARE v_ChildStart_walker DATETIME;
	DECLARE v_ChildEnd_walker DATETIME;
	
	DROP TEMPORARY TABLE IF EXISTS tbl_results;
	CREATE TEMPORARY TABLE IF NOT EXISTS tbl_results  (
		ID int NOT NULL AUTO_INCREMENT PRIMARY KEY
		,ParentID INT DEFAULT null
		,OrderID INT NOT NULL
		,Title text DEFAULT NULL
		,vStart datetime not null
		,vEnd DATETIME NOT NULL
		,PercentComplete decimal(5,2) default 0.0
		,Expanded tinyint(1) DEFAULT NULL
		,Summary TINYINT(1) NOT NULL
	);
	
	
	Nested: BEGIN
		DECLARE bInnerDone INT;
		
		DECLARE Innercurs CURSOR FOR 
			SELECT ProjectManager AS ParentID,MIN(PlanFrom) AS PlanFrom,MAX(PlanTo) AS PlanTo
			FROM tblproject3d
			WHERE PlanFrom IS NOT NULL AND PlanTo IS NOT NULL GROUP BY ProjectManager;
		
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET bInnerDone = 1;
		OPEN Innercurs;
		SET bInnerDone = 0;
			REPEAT
				FETCH Innercurs INTO v_Parent_walker,v_ParentStart_walker,v_ParentEnd_walker;
					
				IF bInnerDone IS FALSE THEN
				
								set v_RecordID_walker = v_RecordID_walker + 1;
				set v_ParentID_walker = v_RecordID_walker;
				
				INSERT INTO tbl_results VALUES (''
								,null
								,0
								,v_Parent_walker
								,v_ParentStart_walker
								,v_ParentEnd_walker
								,0
								,1
								,1);
								
								
				NestedInner: BEGIN
					DECLARE bNestedInnerDone INT;
					
					DECLARE NestedInnercurs CURSOR FOR 
					SELECT PlanFrom,PlanTo,ProjectName 
					FROM tblproject3d 
					WHERE PlanFrom IS NOT NULL AND PlanTo IS NOT NULL AND ProjectManager = v_Parent_walker;
					
					DECLARE CONTINUE HANDLER FOR NOT FOUND SET bNestedInnerDone = 1;
					OPEN NestedInnercurs;
					SET bNestedInnerDone = 0;
						REPEAT
							FETCH NestedInnercurs INTO v_ChildStart_walker, v_ChildEnd_walker, v_Child_walker;
								
							IF bNestedInnerDone IS FALSE THEN
							
														
							SET v_RecordID_walker = v_RecordID_walker + 1;
							
							INSERT INTO tbl_results VALUES (''
								,v_ParentID_walker
								,0
								,v_Child_walker
								,v_ChildStart_walker
								,v_ChildEnd_walker
								,0
								,1
								,0);
								
														
							END IF;
							
						UNTIL bNestedInnerDone END REPEAT;
					CLOSE NestedInnercurs;
				END NestedInner;
				
				
				
					
				END IF;
				
			UNTIL bInnerDone END REPEAT;
		CLOSE Innercurs;
	END Nested;
	
	
	select *
	from tbl_results;
    
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_rptAsset` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rptAsset` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rptAsset`(
IN p_from_date DATE, 
IN p_to_date DATE,
IN p_ma_status VARCHAR(100), 
IN p_contract_type VARCHAR(100), 
in p_asset_owner VARCHAR(100), 
in p_sla_code VARCHAR(100), 
IN p_manage_by VARCHAR(100), 
IN p_site_country VARCHAR(100), 
IN p_site_state VARCHAR(100),
in p_customer VARCHAR(100))
BEGIN
	IF p_from_date = "0000-00-00" THEN
		SET p_from_date = NULL;
	END IF;
	IF p_from_date = "" THEN
		SET p_from_date = NULL;
	END IF;
	IF p_to_date = "0000-00-00" THEN
		SET p_to_date = NULL;
	END IF;
	IF p_to_date = "" THEN
		SET p_to_date = NULL;
	END IF;
	IF p_ma_status = "" OR p_ma_status = "0000000" THEN
		SET p_ma_status = NULL;
	END IF;
	
	IF p_contract_type = "" OR p_contract_type = "0000000" THEN
		SET p_contract_type = NULL;
	END IF;
	
	IF p_manage_by = "" OR p_manage_by = "0000000" THEN
		SET p_manage_by = NULL;
	END IF;
	
	IF p_asset_owner = "" OR p_asset_owner = "0000000" THEN
		SET p_asset_owner = NULL;
	END IF;
	
	IF p_sla_code = "" OR p_sla_code = "0000000" THEN
		SET p_sla_code = NULL;
	END IF;
	
	IF p_site_country = "" OR p_site_country = "0000000" THEN
		SET p_site_country = NULL;
	END IF;
	
	IF p_site_state = "" OR p_site_state = "0000000" THEN
		SET p_site_state = NULL;
	END IF;
	
	IF p_customer = "" OR p_customer = "0000000" THEN
		SET p_customer = NULL;
	END IF;
    
	SELECT 
	a_main.AssetID AS Asset_ID,
	a_main.SystemSN AS Serial_No,
	c_main.ContractNo AS `Contract_No`,
	(SELECT r.mastatusdesc FROM tblmastatus r WHERE r.mastatusid = c_main.MAstatus) AS `MA_Status`,
	c_main.MAStartDate AS `MA_Start_Date`,
	c_main.MAEndDate AS `MA_End_Date`,
	(SELECT r.contracttypedesc FROM `tblcontracttype` r WHERE r.contracttypeid = c_main.Contracttype) AS `Contract_Type`,
	c_main.Duration AS `Contract_Duration`,
	(SELECT r.managedbydesc FROM tblmanagedby r WHERE r.managedbyid = a_main.manageby) AS `Manage_By`,
	a_main.SLACode AS `SLA_Code`,
	(SELECT r.assetownershipdesc FROM `tblassetownership` r WHERE r.assetownershipid = a_main.Assetownership) AS `Asset_Owner`,
	(SELECT r.customername FROM `tblcustomer` r WHERE r.customerid = a_main.customerid) AS `Customer`,
	a_main.PopUpNote AS `Customer_Remarks`,
	a_main.SiteID AS `Site_ID`,
	a_main.SiteName AS `Site_Name`,
	a_main.Siteaddress AS Site_Address,
	a_main.SiteCity AS Site_City,
	(SELECT r.statedesc FROM tblstate r WHERE r.stateid = a_main.SiteState) AS `Site_State`,
	a_main.SitePostcode AS Site_Postcode,
	(SELECT r.countrydesc FROM tblcountry r WHERE r.countryid = a_main.SiteCountry) AS `Site_Country`,
	a_main.SitePICname AS Site_PIC,
	a_main.SitePICemail AS Site_PIC_Email,
	a_main.SitePICcontactno AS Site_PIC_Contact,
	a_main.SitePICMobile AS Site_PIC_Mobile,
	(SELECT r.SystemSN FROM tblasset r WHERE r.AssetID = a_main.MasterAssetID) AS `Master_Asset`
	FROM `tblasset` a_main 
	LEFT JOIN tblcontract c_main ON a_main.ContractID = c_main.ContractID
	WHERE (date(c_main.MAStartDate) >= p_from_date OR p_from_date IS NULL OR p_from_date = "")
	AND (DATE(c_main.MAStartDate) <= p_to_date OR p_to_date IS NULL OR p_to_date = "")
	AND (c_main.MAstatus = p_ma_status OR p_ma_status IS NULL OR p_ma_status = "")
	AND (c_main.Contracttype = p_contract_type OR p_contract_type IS NULL OR p_contract_type = "")
	AND (a_main.manageby = p_manage_by OR p_manage_by IS NULL OR p_manage_by = "")
	AND (a_main.Assetownership = p_asset_owner OR p_asset_owner IS NULL OR p_asset_owner = "")
	AND (a_main.SLACode = p_sla_code OR p_sla_code IS NULL OR p_sla_code = "")
	AND (a_main.SiteCountry = p_site_country OR p_site_country IS NULL OR p_site_country = "")
	AND (a_main.SiteState = p_site_state OR p_site_state IS NULL OR p_site_state = "")
	AND (a_main.customerid = p_customer OR p_customer IS NULL OR p_customer = "");
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_rptClaim` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rptClaim` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rptClaim`(
