		,ClaimsType VARCHAR(255) DEFAULT ''
		,Customer VARCHAR(255) DEFAULT ''
		,SiteAddress VARCHAR(255) DEFAULT ''
		,`Date` DATETIME
		,ResolutionStartTime DATETIME
		,ResolutionEndTime DATETIME
		,Issue text
		,Resolution TEXT
		,Mileage VARCHAR(20) DEFAULT ''
		,Total decimal(10,2) DEFAULT 0.0
		,Remarks TEXT
		,DataStartTime DATETIME
		,DataEndTime DATETIME
		,CalStartTime DATETIME
		,CalEndTime DATETIME
		,OTHours DECIMAL(10,2) DEFAULT 0.0
	);
	
	INSERT INTO tbl_results(Requester, ClaimsType, Customer, SiteAddress, `Date`, ResolutionStartTime, ResolutionEndTime, Issue, Resolution, Mileage, Total)
	SELECT 
	(SELECT r.userfirstname FROM `tbluser` r WHERE r.userid = i_main.assignedto) AS `Requester`,
	(SELECT r.expensetypedesc FROM `tblexpensetype` r WHERE r.expensetypeid = e_main.ExpenseType) AS `ClaimsType`,
	(SELECT r.customername FROM `tblcustomer` r WHERE r.customerid = a_main.customerid) AS `Customer`,
	a_main.Siteaddress AS SiteAddress,
	i_main.reportdatetime AS `Date`,
	i_main.inprogressdt AS ResolutionStartTime,
	i_main.sovleddt AS ResolutionEndTime,
	i_main.incidentdesc AS Issue,
	i_main.incidentres AS Resolution,
	CASE WHEN e_main.ExpenseType = '0000003' THEN
		e_main.Quantity
	ELSE
		''
	END AS Mileage,
	e_main.Expensevalue AS Total
	FROM `tblincidentinfo` i_main 
	LEFT JOIN `tblexpense` e_main ON i_main.inclidentid = e_main.incidentid
	LEFT JOIN `tblasset` a_main ON i_main.assetid = a_main.AssetID
	WHERE e_main.ExpenseType IS NOT NULL
	AND (DATE(e_main.createddate) >= p_from_date OR p_from_date IS NULL OR p_from_date = "")
	AND (DATE(e_main.createddate) <= p_to_date OR p_to_date IS NULL OR p_to_date = "")
	AND (i_main.assignedto = p_engineer OR p_engineer IS NULL OR p_engineer = "")
	order by i_main.assignedto, e_main.ExpenseType;
	
	Nested: BEGIN
		DECLARE bInnerDone INT;
		
		DECLARE Innercurs CURSOR FOR 
		SELECT u_main.userfirstname AS `Requester`,
						'OT' AS `ClaimsType`,
			(SELECT r.customername FROM `tblcustomer` r WHERE r.customerid = a_main.customerid) AS `Customer`,
			a_main.Siteaddress AS SiteAddress,
			i_main.reportdatetime AS `Date`,
			i_main.inprogressdt AS ResolutionStartTime,
			i_main.sovleddt AS ResolutionEndTime,
			i_main.incidentdesc AS Issue,
			i_main.incidentres AS Resolution,
			ap_main.startdt AS AppointmentStart,
			ap_main.enddt AS AppointmentEnd,
			r_main.otrates AS OTHourRate
			FROM `tblincidentinfo` i_main
			LEFT JOIN `tblappointment` ap_main ON i_main.inclidentid = ap_main.refno
			LEFT JOIN `tblasset` a_main ON i_main.assetid = a_main.AssetID
			LEFT JOIN `tbluser` u_main ON u_main.userid = i_main.assignedto
			LEFT JOIN `tblrategroup` r_main ON u_main.groupid = r_main.rategroupid
			WHERE ap_main.`aid` IS NOT NULL
			AND (DATE(ap_main.startdt) >= p_from_date OR p_from_date IS NULL OR p_from_date = "")
			AND (DATE(ap_main.startdt) <= p_to_date OR p_to_date IS NULL OR p_to_date = "")
			AND (i_main.assignedto = p_engineer OR p_engineer IS NULL OR p_engineer = "");
		
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET bInnerDone = 1;
		OPEN Innercurs;
		SET bInnerDone = 0;
			REPEAT
				FETCH Innercurs INTO v_Requester_walker,v_ClaimsType_walker,v_Customer_walker,v_SiteAddress_walker, v_Date_walker, v_ResolutionStartTime_walker,
							v_ResolutionEndTime_walker,v_Issue_walker,v_Resolution_walker, v_AppointmentStart_walker,v_AppointmentEnd_walker, v_OTHourRate_walker;
					
				IF bInnerDone IS FALSE THEN
				
								set v_ot_hours_cal = 0; 				
				set v_startdatetime_cal = date(v_AppointmentStart_walker);
				
				SET v_enddatetime_cal = DATE(v_AppointmentStart_walker);
				
				SET v_startdatetime_cal = ADDDATE(v_startdatetime_cal, INTERVAL OT_START_HOUR HOUR);
				
				SET v_enddatetime_cal = ADDDATE(v_enddatetime_cal, INTERVAL OT_END_HOUR HOUR);
				
				WHILE v_startdatetime_cal < v_AppointmentEnd_walker DO 
					if v_startdatetime_cal < v_AppointmentStart_walker THEN
						set v_startdatetime_cal = v_AppointmentStart_walker;
					END if;
					
					IF v_enddatetime_cal > v_AppointmentEnd_walker THEN
						set v_enddatetime_cal = v_AppointmentEnd_walker;
					END IF;
					
					if v_startdatetime_cal < v_enddatetime_cal then
						set v_ot_hours_cal = v_ot_hours_cal + IFNULL(TIMESTAMPDIFF(SECOND,v_startdatetime_cal,v_enddatetime_cal)/3600,0); 					END IF;
					
					SET v_startdatetime_cal = DATE(ADDDATE(v_startdatetime_cal, INTERVAL 1 DAY));
				
					SET v_enddatetime_cal = v_startdatetime_cal;
					
					SET v_startdatetime_cal = ADDDATE(v_startdatetime_cal, INTERVAL OT_START_HOUR HOUR);
					
					SET v_enddatetime_cal = ADDDATE(v_enddatetime_cal, INTERVAL OT_END_HOUR HOUR);
					
				END WHILE;
								
				
								set v_Total = ifnull(v_ot_hours_cal*v_OTHourRate_walker,0);
				
				if v_ot_hours_cal > 0 THEN 					INSERT INTO tbl_Results VALUES (v_Requester_walker
								,v_ClaimsType_walker
								,v_Customer_walker
								,v_SiteAddress_walker
								,v_Date_walker
								,v_ResolutionStartTime_walker
								,v_ResolutionEndTime_walker
								,v_Issue_walker
								,v_Resolution_walker
								,''
								,v_Total
								,''
								,v_AppointmentStart_walker
								,v_AppointmentEnd_walker
								,v_startdatetime_cal
								,v_enddatetime_cal
								,v_ot_hours_cal);
				END IF;  					
				END IF;
				
			UNTIL bInnerDone END REPEAT;
		CLOSE Innercurs;
	END Nested;
	
	
	SELECT * FROM tbl_results;
    
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_rptContract` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rptContract` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rptContract`(
IN p_from_date DATE, 
IN p_to_date DATE,
IN p_country VARCHAR(100), 
IN p_currency VARCHAR(100), 
IN p_sold_to_customer VARCHAR(100), 
IN p_sold_to_country VARCHAR(100), 
IN p_sold_to_state VARCHAR(100), 
IN p_ship_to_customer VARCHAR(100), 
IN p_ship_to_country VARCHAR(100), 
IN p_ship_to_state VARCHAR(100), 
IN p_contract_type VARCHAR(100),
IN p_ma_status VARCHAR(100), 
IN p_billing_frequency VARCHAR(100), 
IN p_pm_frequency VARCHAR(100), 
IN p_contract_renewal_stage VARCHAR(100), 
IN p_contract_renewal_confident_level VARCHAR(100), 
IN p_out_source_vendor VARCHAR(100))
BEGIN
	IF p_from_date = "0000-00-00" THEN
		SET p_from_date = NULL;
	END IF;
	
	IF p_to_date = "0000-00-00" THEN
		SET p_to_date = NULL;
	END IF;
	
	IF p_country = "" OR p_country = "0000000" THEN
		SET p_country = NULL;
	END IF;
	
	IF p_currency = "" OR p_currency = "0000000" THEN
		SET p_currency = NULL;
	END IF;
	
	IF p_sold_to_customer = "" OR p_sold_to_customer = "0000000" THEN
		SET p_sold_to_customer = NULL;
	END IF;
	
	IF p_sold_to_country = "" OR p_sold_to_country = "0000000" THEN
		SET p_sold_to_country = NULL;
	END IF;
	
	IF p_sold_to_state = "" OR p_sold_to_state = "0000000" THEN
		SET p_sold_to_state = NULL;
	END IF;
	
	IF p_ship_to_customer = "" OR p_ship_to_customer = "0000000" THEN
		SET p_ship_to_customer = NULL;
	END IF;
	
	IF p_ship_to_country = "" OR p_ship_to_country = "0000000" THEN
		SET p_ship_to_country = NULL;
	END IF;
	
	IF p_ship_to_state = "" OR p_ship_to_state = "0000000" THEN
		SET p_ship_to_state = NULL;
	END IF;
	
	IF p_contract_type = "" OR p_contract_type = "0000000" THEN
		SET p_contract_type = NULL;
	END IF;
	
	IF p_contract_type = "" OR p_contract_type = "0000000" THEN
		SET p_contract_type = NULL;
	END IF;
	
	IF p_ma_status = "" OR p_ma_status = "0000000" THEN
		SET p_ma_status = NULL;
	END IF;
	
	IF p_billing_frequency = "" OR p_billing_frequency = "0000000" THEN
		SET p_billing_frequency = NULL;
	END IF;
	
	IF p_pm_frequency = "" OR p_pm_frequency = "0000000" THEN
		SET p_pm_frequency = NULL;
	END IF;
	
	IF p_contract_renewal_stage = "" OR p_contract_renewal_stage = "0000000" THEN
		SET p_contract_renewal_stage = NULL;
	END IF;
	
	IF p_contract_renewal_confident_level = "" OR p_contract_renewal_confident_level = "0000000" THEN
		SET p_contract_renewal_confident_level = NULL;
	END IF;
	
	IF p_out_source_vendor = "" OR p_out_source_vendor = "0000000" THEN
		SET p_out_source_vendor = NULL;
	END IF;
    
	SELECT c_main.ContractID AS Contract_ID,
	c_main.ContractNo AS Contract_No,
	c_main.ContractName AS Contract_Name,
	(SELECT r.countrydesc FROM tblcountry r WHERE r.countryid = c_main.ShiptoCountry) AS `Country`,
	(SELECT r.currencydesc FROM tblcurrency r WHERE r.currencyid = c_main.Currency) AS `Currency`,
	(SELECT r.customername FROM tblcustomer r WHERE r.customerid = c_main.Soldtocustomer) AS `Sold_To_Customer`,
	c_main.SoldtoAddress AS Sold_To_Address,
	c_main.SoldtoCity AS Sold_To_City,
	(SELECT r.statedesc FROM tblstate r WHERE r.stateid = c_main.SoldtoState) AS `Sold_To_State`,
	c_main.SoldtoPostcode AS Sold_To_Postcode,
	(SELECT r.countrydesc FROM tblcountry r WHERE r.countryid = c_main.SoldtoCountry) AS `Sold_To_Country`,
	(SELECT r.customername FROM tblcustomer r WHERE r.customerid = c_main.Shiptocustomer) AS `Ship_To_Customer`,
	c_main.ShiptoAddress AS Ship_To_Address,
	c_main.ShiptoCity AS Ship_To_City,
	(SELECT r.statedesc FROM tblstate r WHERE r.stateid = c_main.ShiptoState) AS `Ship_To_State`,
	c_main.ShiptoPostcode AS Ship_To_Postcode,
	(SELECT r.countrydesc FROM tblcountry r WHERE r.countryid = c_main.ShiptoCountry) AS `Ship_To_Country`,
	c_main.PICName AS PIC_Name,
	c_main.PICEmail AS PIC_Email,
	c_main.PICContact AS PIC_No,
	c_main.Salesname AS Sales_Name,
	c_main.Salesemail AS Sales_Email,
	(SELECT r.contracttypedesc FROM `tblcontracttype` r WHERE r.contracttypeid = c_main.Contracttype) AS `Contract_Type`,
	(SELECT r.mastatusdesc FROM tblmastatus r WHERE r.mastatusid = c_main.MAstatus) AS `MA_Status`,
	(SELECT r.billingfreqdesc FROM tblbillingfreq r WHERE r.billingfreqid = c_main.Billingfrequency) AS `Billing_Frequency`,
	(SELECT r.pmfreqdesc FROM tblpmfreq r WHERE r.pmfreqid = c_main.PreventiveMaintenanceFrequency) AS `PM_Frequency`,
	c_main.NextServiceDate AS Next_Service_Date,
	(SELECT r.contractconfidentleveldesc FROM tblcontractconfidentlevel r WHERE r.contractconfidentlevelid = c_main.Contractrenewalstage) AS `Contract_Renewal_Stage`,
	c_main.OldContractNo AS Old_Contract_No,
	(SELECT r.contractrenewalstagedesc FROM tblcontractrenewalstage r WHERE r.contractrenewalstageid = c_main.Contractrenewalconfidentlevel) AS `Contract_Renewal_Confident_Level`,
	c_main.Duration AS `Duration_Month`,
	(SELECT r.companyname FROM tblsupplier r WHERE r.supplierid = c_main.Outsourcevendor) AS `Out_Source_Vendor`,
	c_main.MAStartDate AS `MA_Start`,
	c_main.MAEndDate AS `MA_End`,
	c_main.TCV AS `TCV_RM`,
	c_main.ACV AS `ACV_RM`,
	IFNULL(c_main.TCV/(SELECT r.rates FROM `tblexchangerates` r WHERE r.currency1 = 'USD' AND r.currency2 = 'MYR' LIMIT 1),0) AS `TVC_USD`,
	IFNULL(c_main.ACV/(SELECT r.rates FROM `tblexchangerates` r WHERE r.currency1 = 'USD' AND r.currency2 = 'MYR' LIMIT 1),0) AS `ACV_USD`,
	c_main.POno AS `PO_Number`,
	c_main.SORno AS `SOR_Number`,
	c_main.SORdate AS `SOR_Date`,
	c_main.Remarks AS `Contract_Remarks`
	FROM `tblcontract` c_main
	WHERE (DATE(c_main.MAStartDate) >= p_from_date OR p_from_date IS NULL OR p_from_date = "")
	AND (DATE(c_main.MAStartDate) <= p_to_date OR p_to_date IS NULL OR p_to_date = "")
	AND (c_main.ShiptoCountry = p_country OR p_country IS NULL OR p_country = "")
	AND (c_main.Currency = p_currency OR p_currency IS NULL OR p_currency = "")
	AND (c_main.Soldtocustomer = p_sold_to_customer OR p_sold_to_customer IS NULL OR p_sold_to_customer = "")
	AND (c_main.SoldtoCountry = p_sold_to_country OR p_sold_to_country IS NULL OR p_sold_to_country = "")
	AND (c_main.SoldtoState = p_sold_to_state OR p_sold_to_state IS NULL OR p_sold_to_state = "")
	AND (c_main.Shiptocustomer = p_ship_to_customer OR p_ship_to_customer IS NULL OR p_ship_to_customer = "")
	AND (c_main.ShiptoCountry = p_ship_to_country OR p_ship_to_country IS NULL OR p_ship_to_country = "")
	AND (c_main.ShiptoState = p_ship_to_state OR p_ship_to_state IS NULL OR p_ship_to_state = "")
	AND (c_main.Contracttype = p_contract_type OR p_contract_type IS NULL OR p_contract_type = "")
	AND (c_main.MAstatus = p_ma_status OR p_ma_status IS NULL OR p_ma_status = "")
	AND (c_main.Billingfrequency = p_billing_frequency OR p_billing_frequency IS NULL OR p_billing_frequency = "")
	AND (c_main.PreventiveMaintenanceFrequency = p_pm_frequency OR p_pm_frequency IS NULL OR p_pm_frequency = "")
	AND (c_main.Contractrenewalstage = p_contract_renewal_stage OR p_contract_renewal_stage IS NULL OR p_contract_renewal_stage = "")
	AND (c_main.Contractrenewalconfidentlevel = p_contract_renewal_confident_level OR p_contract_renewal_confident_level IS NULL OR p_contract_renewal_confident_level = "")
	AND (c_main.Outsourcevendor = p_out_source_vendor OR p_out_source_vendor IS NULL OR p_out_source_vendor = "");
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_rptCustomer` */

