DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rptCustomer`(
IN p_from_date DATE, 
IN p_to_date DATE,
IN p_status VARCHAR(100), 
IN p_manage_by VARCHAR(100), 
IN p_country VARCHAR(100), 
