BEGIN
	IF p_from_date = "0000-00-00" THEN
		SET p_from_date = NULL;
	END IF;
	IF p_to_date = "0000-00-00" THEN
		SET p_to_date = NULL;
	END IF;
	
	IF p_status = "" OR p_status = "0000000" THEN
		SET p_status = NULL;
	END IF;
	
	IF p_manage_by = "" OR p_manage_by = "0000000" THEN
		SET p_manage_by = NULL;
	END IF;
	
	IF p_country = "" OR p_country = "0000000" THEN
		SET p_country = NULL;
	END IF;
	
	IF p_state = "" OR p_state = "0000000" THEN
		SET p_state = NULL;
	END IF;
    
	SELECT 
	c_main.customerid AS CUSTOMER_ID,
	c_main.customername AS CUSTOMER_NAME,
	c_main.altenativename AS ALTERNATE_NAME,
	(SELECT r.statusdesc FROM tblcustomerstatus r WHERE r.statusid = c_main.statusid) AS `STATUS`,
	c_main.registrationdate AS  REGISTRATION_DATE,
	(SELECT r.managedbydesc FROM tblmanagedby r WHERE r.managedbyid = c_main.managedby) AS `MANAGE_BY`,
	c_main.Refno AS FINANCE_REF_NO,
	c_main.address AS ADDRESS,
	(SELECT r.statedesc FROM tblstate r WHERE r.stateid = c_main.state) AS `STATE`,
	c_main.city AS CITY,
	c_main.zip AS POST_CODE,
	(SELECT r.countrydesc FROM tblcountry r WHERE r.countryid = c_main.countryid) AS `COUNTRY`,
	c_main.mobileno AS MOBILE_NO,
	c_main.faxno AS FAX_NO,
	c_main.email AS EMAIL,
	c_main.remarks AS REMARKS,
	c_main.accountmanager AS ACCOUNT_MANAGER,
	c_main.URL AS URL
	FROM `tblcustomer` c_main
	WHERE (date(c_main.registrationdate) >= p_from_date OR p_from_date IS NULL OR p_from_date = "")
	AND (DATE(c_main.registrationdate) <= p_to_date OR p_to_date IS NULL OR p_to_date = "")
	AND (c_main.statusid = p_status OR p_status IS NULL OR p_status = "")
	AND (c_main.managedby = p_manage_by OR p_manage_by IS NULL OR p_manage_by = "")
	AND (c_main.countryid = p_country OR p_country IS NULL OR p_country = "")
	AND (c_main.state = p_state OR p_state IS NULL OR p_state = "");
    END */$$
