/* Procedure structure for procedure `sp_rptMonthlyByCustomer` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rptMonthlyByCustomer` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rptMonthlyByCustomer`(
IN p_month_date DATE, 
IN p_country VARCHAR(100))
BEGIN
	IF p_month_date = "0000-00-00" THEN
		SET p_month_date = NULL;
	END IF;
	
	IF p_country = "" OR p_country = "0000000" THEN
		SET p_country = NULL;
	END IF;
    
	SELECT v_main.inc_inclidentid AS ID, 
	v_main.inc_reportdatetime AS LogDateTime,
	(SELECT r.statusdesc FROM tblstatus r WHERE r.statusid = v_main.inc_status) AS `Status`,
	(SELECT r.reasondesc FROM tblstatusreason r WHERE r.reasonid = v_main.statusreason) AS StatusReason,
	(SELECT r.enquirytypedesc FROM tblenquirytype r WHERE r.enquirytypeid = v_main.requesttype) AS RequestType,
	(SELECT r.prioritydesc FROM tblpriority r WHERE r.priorityid = v_main.inc_priority) AS Priority,
	v_main.inc_duedatetime AS DueDatetime,
	(SELECT r.customername FROM tblcustomer r WHERE r.customerid = v_main.inc_customerid) AS Customer,
	(SELECT r.userfirstname FROM `tbluser` r WHERE r.userid = v_main.inc_assignedto) AS Engineer,
	v_main.inc_assignedto as EngineerID,
	p_month_date as PARAM_Month
	FROM v_tracking v_main
	WHERE (month(v_main.inc_reportdatetime) = MONTH(p_month_date))
	AND (YEAR(v_main.inc_reportdatetime) = YEAR(p_month_date))
	AND (v_main.inc_countryid = p_country OR p_country IS NULL OR p_country = "");
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_rptProfitabilityByCountry` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rptProfitabilityByCountry` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rptProfitabilityByCountry`(
IN p_from_date DATE, 
IN p_to_date DATE, 
IN p_country VARCHAR(100),
IN p_customer VARCHAR(100),
IN p_contract_no VARCHAR(100))
BEGIN
	DECLARE OT_START_HOUR INT DEFAULT 18; 	DECLARE OT_END_HOUR INT DEFAULT 24; 	
	DECLARE v_startdatetime_cal DATETIME;
	DECLARE v_enddatetime_cal DATETIME;
	DECLARE v_ot_hours_cal decimal(10,2) default 0.0;
	DECLARE v_TotalLabourCost_cal DECIMAL(10,2) DEFAULT 0.0;
	
	DECLARE v_IncidentID_walker VARCHAR(50) DEFAULT '';
	DECLARE v_Country_walker VARCHAR(255) DEFAULT '';
	DECLARE v_CustomerName_walker VARCHAR(255) DEFAULT '';
	DECLARE v_CustomerID_walker VARCHAR(50) DEFAULT '';
	DECLARE v_ContractNo_walker VARCHAR(100) DEFAULT '';
	DECLARE v_TotalIncidentalCost_walker DECIMAL(10,2) DEFAULT 0.0;
	DECLARE v_TotalACV_walker DECIMAL(10,2) DEFAULT 0.0;
	DECLARE v_AppointmentStart_walker DATETIME;
	DECLARE v_AppointmentEnd_walker DATETIME;
	declare v_OTHourRate_walker decimal(9,2) default 0.0;
	
	declare v_Total decimal(10,2) DEFAULT 0.0;
	
	IF p_from_date = "" OR p_from_date = "0000-00-00" THEN
		SET p_from_date = NULL;
	END IF;
	
	IF p_to_date = "" OR p_to_date = "0000-00-00" THEN
		SET p_to_date = NULL;
	END IF;
	
	IF p_country = "" OR p_country = "0000000" THEN
		SET p_country = NULL;
	END IF;
	
	IF p_customer = "" OR p_customer = "0000000" THEN
		SET p_customer = NULL;
	END IF;
	
	IF p_contract_no = "" OR p_contract_no = "0000000" THEN
		SET p_contract_no = NULL;
	END IF;
	
	DROP TEMPORARY TABLE IF EXISTS tbl_results_temp;
	CREATE TEMPORARY TABLE IF NOT EXISTS tbl_results_temp  (
		IncidentID VARCHAR(50) DEFAULT ''
		,CountryID VARCHAR(100) DEFAULT ''
		,CustomerID VARCHAR(100) DEFAULT ''
		,ContractID VARCHAR(100) DEFAULT ''
		,TotalIncidentalCost DECIMAL(10,2) DEFAULT 0.0
		,TotalLabourCost DECIMAL(10,2) DEFAULT 0.0
	);
	
	DROP TEMPORARY TABLE IF EXISTS tbl_results;
	CREATE TEMPORARY TABLE IF NOT EXISTS tbl_results  (
		Country VARCHAR(255) DEFAULT ''
		,CustomerName VARCHAR(255) DEFAULT ''
		,CustomerID VARCHAR(100) DEFAULT ''
		,ContractID VARCHAR(100) DEFAULT ''
		,ContractNo VARCHAR(100) DEFAULT ''
		,TotalNoOfSR int default 0
		,TotalIncidentalCost decimal(10,2) default 0.0
		,TotalLabourCost DECIMAL(10,2) DEFAULT 0.0
		,TotalACV DECIMAL(10,2) DEFAULT 0.0
	);
	
	DROP TEMPORARY TABLE IF EXISTS tbl_appointment_temp;
	CREATE TEMPORARY TABLE IF NOT EXISTS tbl_appointment_temp  (
		Total DECIMAL(10,2) DEFAULT 0.0
		,DataStartTime DATETIME
		,DataEndTime DATETIME
		,CalStartTime DATETIME
		,CalEndTime DATETIME
		,OTHours DECIMAL(10,2) DEFAULT 0.0
	);
	
	
	Nested: BEGIN
		DECLARE bInnerDone INT;
		
		DECLARE Innercurs CURSOR FOR 
		SELECT  i_main.inclidentid as IncidentID,
			i_main.countryid AS `CountryID`,
			i_main.customerid AS `CustmerID`,
			i_main.contractno AS `ContractID`,
			IFNULL(e_main.Expensevalue,0) AS TotalIncidentalCost
						FROM `tblincidentinfo` i_main 
			LEFT JOIN `tblexpense` e_main ON i_main.inclidentid = e_main.incidentid
			LEFT JOIN `tblcontract` c_main ON i_main.contractno = c_main.ContractID
			WHERE (DATE(i_main.reportdatetime) >= p_from_date OR p_from_date IS NULL OR p_from_date = "0000-00-00")
			AND (DATE(i_main.reportdatetime) <= p_to_date OR p_to_date IS NULL OR p_to_date = "0000-00-00")
			AND (i_main.countryid = p_country OR p_country IS NULL OR p_country = "")
			AND (i_main.customerid = p_customer OR p_customer IS NULL OR p_customer = "")
			AND (i_main.contractno = p_contract_no OR p_contract_no IS NULL OR p_contract_no = "")
			GROUP BY i_main.inclidentid;
		
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET bInnerDone = 1;
		OPEN Innercurs;
		SET bInnerDone = 0;
			REPEAT
				FETCH Innercurs INTO v_IncidentID_walker,v_Country_walker,v_CustomerID_walker, v_ContractNo_walker, v_TotalIncidentalCost_walker;
					
				IF bInnerDone IS FALSE THEN
				
				set v_TotalLabourCost_cal = 0; 				
				NestedInner: BEGIN
					DECLARE bNestedInnerDone INT;
					
					DECLARE NestedInnercurs CURSOR FOR 
					SELECT a.startdt, a.enddt, r.otrates
					FROM tblappointment a 
					LEFT JOIN `tbluser` u ON u.userid = a.UserID
					LEFT JOIN `tblrategroup` r ON u.groupid = r.rategroupid
					WHERE a.refno = v_IncidentID_walker;
					
					DECLARE CONTINUE HANDLER FOR NOT FOUND SET bNestedInnerDone = 1;
					OPEN NestedInnercurs;
					SET bNestedInnerDone = 0;
						REPEAT
							FETCH NestedInnercurs INTO v_AppointmentStart_walker, v_AppointmentEnd_walker, v_OTHourRate_walker;
								
							IF bNestedInnerDone IS FALSE THEN
							
							
														SET v_ot_hours_cal = 0; 							
							SET v_startdatetime_cal = DATE(v_AppointmentStart_walker);
							
							SET v_enddatetime_cal = DATE(v_AppointmentStart_walker);
							
							SET v_startdatetime_cal = ADDDATE(v_startdatetime_cal, INTERVAL OT_START_HOUR HOUR);
							
							SET v_enddatetime_cal = ADDDATE(v_enddatetime_cal, INTERVAL OT_END_HOUR HOUR);
							
							WHILE v_startdatetime_cal < v_AppointmentEnd_walker DO 
								IF v_startdatetime_cal < v_AppointmentStart_walker THEN
									SET v_startdatetime_cal = v_AppointmentStart_walker;
								END IF;
								
								IF v_enddatetime_cal > v_AppointmentEnd_walker THEN
									SET v_enddatetime_cal = v_AppointmentEnd_walker;
								END IF;
								
								IF v_startdatetime_cal < v_enddatetime_cal THEN
									SET v_ot_hours_cal = v_ot_hours_cal + IFNULL(TIMESTAMPDIFF(SECOND,v_startdatetime_cal,v_enddatetime_cal)/3600,0); 								END IF;
								
								SET v_startdatetime_cal = DATE(ADDDATE(v_startdatetime_cal, INTERVAL 1 DAY));
							
								SET v_enddatetime_cal = v_startdatetime_cal;
								
								SET v_startdatetime_cal = ADDDATE(v_startdatetime_cal, INTERVAL OT_START_HOUR HOUR);
								
								SET v_enddatetime_cal = ADDDATE(v_enddatetime_cal, INTERVAL OT_END_HOUR HOUR);
								
							END WHILE;
														
														SET v_TotalLabourCost_cal = v_TotalLabourCost_cal + IFNULL(v_ot_hours_cal*v_OTHourRate_walker,0);
							SET v_Total = IFNULL(v_ot_hours_cal*v_OTHourRate_walker,0);
							
							IF v_ot_hours_cal > 0 THEN 								INSERT INTO tbl_appointment_temp VALUES (v_Total
											,v_AppointmentStart_walker
											,v_AppointmentEnd_walker
											,v_startdatetime_cal
											,v_enddatetime_cal
											,v_ot_hours_cal);
							END IF;  							
							END IF;
							
						UNTIL bNestedInnerDone END REPEAT;
					CLOSE NestedInnercurs;
				END NestedInner;
				
				
				INSERT INTO tbl_results_temp VALUES (v_IncidentID_walker
								,v_Country_walker
								,v_CustomerID_walker
								,v_ContractNo_walker
								,v_TotalIncidentalCost_walker
								,v_TotalLabourCost_cal);
					
				END IF;
				
			UNTIL bInnerDone END REPEAT;
		CLOSE Innercurs;
	END Nested;
	
		INSERT INTO tbl_results (Country, CustomerName, CustomerID, ContractID, ContractNo, TotalNoOfSR, TotalIncidentalCost, TotalLabourCost, TotalACV)
	SELECT 
	(SELECT r.countrydesc FROM `tblcountry` r WHERE r.countryid = r_main.CountryID limit 1) AS `Country`,
	(SELECT r.customername FROM `tblcustomer` r WHERE r.customerid = r_main.CustomerID LIMIT 1) AS `CustomerName`,
	r_main.CustomerID,
	r_main.ContractID,
	(SELECT r.ContractNo FROM `tblcontract` r WHERE r.ContractID = r_main.ContractID LIMIT 1) as ContractNo,
	count(Distinct r_main.IncidentID) as TotalNoOfSR,
	sum(r_main.TotalIncidentalCost),
	sum(r_main.TotalLabourCost),
	ifnull((SELECT r.ACV FROM `tblcontract` r WHERE r.ContractID = r_main.ContractID LIMIT 1),0) AS TotalACV
	FROM tbl_results_temp r_main
	group by CountryID, CustomerID, ContractID;
	
	
	select *,
	(SELECT r.countrydesc FROM `tblcountry` r WHERE r.countryid = p_country LIMIT 1) AS `Param_Country`,
	p_from_date as Param_From_Date,
	p_to_date as Param_To_Date
	from tbl_results;
	    
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_rptUtilisationHoursEngineer` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rptUtilisationHoursEngineer` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rptUtilisationHoursEngineer`(
IN p_from_date DATE, 
IN p_to_date DATE,
IN p_engineer VARCHAR(100))
BEGIN
	
	DECLARE counter_date DATE;
	declare from_date DATE;
	declare to_date DATE;
	DECLARE weekly_date VARCHAR(100) DEFAULT '';
	DECLARE v_categorization VARCHAR(255) DEFAULT '';
	DECLARE v_project VARCHAR(255) DEFAULT '';
	DECLARE v_hours DECIMAL(10,2) DEFAULT 0.0;
	DECLARE v_startdatetime_cal DATETIME;
	DECLARE v_enddatetime_cal DATETIME;
	DECLARE v_sort_categorization_counter int default 0;
	DECLARE v_sort_project_counter INT DEFAULT 0;
	
	DECLARE v_weekly_start_walker DATETIME;
	DECLARE v_weekly_end_walker DATETIME;
	DECLARE v_weekly_range_walker VARCHAR(100) DEFAULT '';
	DECLARE v_weekly_counter INT DEFAULT 0;
	
	DECLARE v_engineer_id_appointment_walker VARCHAR(255) DEFAULT '';
	DECLARE v_engineer_name_appointment_walker VARCHAR(255) DEFAULT '';
	DECLARE v_startdatetime_appointment_walker datetime;
	DECLARE v_enddatetime_appointment_walker DATETIME;
	DECLARE v_project_appointment_walker VARCHAR(100) DEFAULT '';
	DECLARE v_refno_appointment_walker VARCHAR(100) DEFAULT '';
	DECLARE v_operationalcat_appointment_walker VARCHAR(100) DEFAULT '';
	DECLARE v_atype_appointment_walker VARCHAR(100) DEFAULT '';
	
	DROP TEMPORARY TABLE IF EXISTS tbl_weekly;
	CREATE TEMPORARY TABLE IF NOT EXISTS tbl_weekly  (
		Daily_Date date DEFAULT '0000-00-00'
		,Weekly VARCHAR(30) DEFAULT ''
		,p_fromDate VARCHAR(50) DEFAULT ''
		,p_toDate VARCHAR(50) DEFAULT ''
	);
	
	DROP TEMPORARY TABLE IF EXISTS tbl_results;
	CREATE TEMPORARY TABLE IF NOT EXISTS tbl_results  (
		Engineer_ID VARCHAR(100) DEFAULT ''
		,Engineer VARCHAR(100) DEFAULT ''
		,Categorization VARCHAR(255) DEFAULT ''
		,Projects VARCHAR(255) DEFAULT ''
		,StartDateTime_Cal DATETIME
		,EndDateTime_Cal DATETIME
		,StartDateTime_Data DATETIME
		,EndDateTime_Data DATETIME
		,Hours decimal(10,2) DEFAULT 0.0
		,SortCategorization int DEFAULT 0
		,SortProjects INT DEFAULT 0
	);
	
	IF p_engineer = "" OR p_engineer = "0000000" THEN
		SET p_engineer = NULL;
	END IF;
	
	set p_to_date = ADDDATE(p_to_date, INTERVAL 1 DAY);     
	SET counter_date=p_from_date;
	WHILE counter_date <= p_to_date DO
	    SELECT DATE_FORMAT(DATE_ADD(counter_date, INTERVAL(2-DAYOFWEEK(counter_date)) DAY),'%Y-%m-%e') INTO from_date;
	    
	    	    if from_date < p_from_date then
		set from_date = p_from_date;
	    END IF;
	    
	    SELECT DATE_FORMAT(DATE_ADD(counter_date, INTERVAL(8-DAYOFWEEK(counter_date)) DAY),'%Y-%m-%e') INTO to_date;
	    
	    	    IF p_to_date < to_date THEN
		SET to_date = p_to_date;
	    END IF;
	    
	    SELECT concat(from_date,' to ',to_date) INTO weekly_date;
	    
	    INSERT INTO tbl_weekly VALUES(counter_date,weekly_date,from_date,to_date);
	    SET counter_date = ADDDATE(counter_date, INTERVAL 1 DAY);
	END WHILE;
	
	
	Nested: BEGIN
		DECLARE bInnerDone INT;
		
		DECLARE Innercurs CURSOR FOR 
		SELECT w.p_fromDate,w.p_toDate,w.Weekly
		FROM tbl_weekly w
		Group by w.Weekly
		ORDER BY w.p_fromDate;
		
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET bInnerDone = 1;
		OPEN Innercurs;
		SET bInnerDone = 0;
			REPEAT
				FETCH Innercurs INTO v_weekly_start_walker,v_weekly_end_walker,v_weekly_range_walker;
					
				IF bInnerDone IS FALSE THEN
				
				set v_weekly_counter = v_weekly_counter + 1;
				
				NestedInner: BEGIN
					DECLARE bNestedInnerDone INT;
					
					DECLARE NestedInnercurs CURSOR FOR 
					SELECT a.UserID, (SELECT userfirstname FROM tbluser u WHERE u.userid = a.UserID), a.startdt, a.enddt, a.Project, a.refno, a.OperationalCat, a.atype
					FROM tblappointment a 
					WHERE ((a.startdt >= v_weekly_start_walker AND a.startdt <= v_weekly_end_walker) OR 
					(a.enddt >= v_weekly_start_walker AND a.enddt <= v_weekly_end_walker))
					AND (a.UserID = p_engineer OR p_engineer IS NULL OR p_engineer = "");
					
					DECLARE CONTINUE HANDLER FOR NOT FOUND SET bNestedInnerDone = 1;
					OPEN NestedInnercurs;
					SET bNestedInnerDone = 0;
						REPEAT
							FETCH NestedInnercurs INTO v_engineer_id_appointment_walker, v_engineer_name_appointment_walker, v_startdatetime_appointment_walker, v_enddatetime_appointment_walker, 
										v_project_appointment_walker, v_refno_appointment_walker, v_operationalcat_appointment_walker, v_atype_appointment_walker;
								
							IF bNestedInnerDone IS FALSE THEN
							
							
							
														set v_hours = 0;
							if v_startdatetime_appointment_walker < v_weekly_start_walker and v_enddatetime_appointment_walker > ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY) THEN
								SELECT ifnull(TIMESTAMPDIFF(SECOND,v_weekly_start_walker,ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY))/3600,0) into v_hours;
								set v_startdatetime_cal = v_weekly_start_walker;
								set v_enddatetime_cal = ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY);
							ELSEIF v_startdatetime_appointment_walker < v_weekly_start_walker THEN
								SELECT IFNULL(TIMESTAMPDIFF(SECOND,v_weekly_start_walker,v_enddatetime_appointment_walker)/3600,0) INTO v_hours;
								SET v_startdatetime_cal = v_weekly_start_walker;
								SET v_enddatetime_cal = v_enddatetime_appointment_walker;
							ELSEIF v_enddatetime_appointment_walker > ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY) THEN
								SELECT IFNULL(TIMESTAMPDIFF(SECOND,v_startdatetime_appointment_walker,ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY))/3600,0) INTO v_hours;
								SET v_startdatetime_cal = v_startdatetime_appointment_walker;
								SET v_enddatetime_cal = v_weekly_end_walker;
							ELSE
								SELECT IFNULL(TIMESTAMPDIFF(SECOND,v_startdatetime_appointment_walker,v_enddatetime_appointment_walker)/3600,0) INTO v_hours;
								SET v_startdatetime_cal = v_startdatetime_appointment_walker;
								SET v_enddatetime_cal = v_enddatetime_appointment_walker;
							END IF;
							
							
														set v_project = "";
							set v_categorization = "";
							
							if v_project_appointment_walker <> "" THEN
								SELECT ProjectName FROM `tblproject3d` WHERE ProjectID = v_project_appointment_walker LIMIT 1 INTO v_project;
								set v_categorization = 'Productive';
								set v_sort_categorization_counter = 1;
								SET v_sort_project_counter = 1;
							ELSEIF v_refno_appointment_walker <> "" THEN
								SET v_project = 'Incidents';
								SET v_categorization = 'Productive';
								SET v_sort_categorization_counter = 1;
								SET v_sort_project_counter = 2;
							ELSEIF v_operationalcat_appointment_walker <> "" THEN
								SELECT category_report FROM `tbloctier2` WHERE tierid = v_operationalcat_appointment_walker LIMIT 1 INTO v_categorization;
								if v_categorization = "Productive" THEN 
									SET v_project = 'Misc - Productive';
									SET v_sort_categorization_counter = 1;
								ELSEIF v_categorization = "Non-Productive" THEN
									SET v_project = 'Misc - Non Productive';
									SET v_sort_categorization_counter = 2;
								END IF;
								SET v_sort_project_counter = 4;
							ELSEIF v_atype_appointment_walker <> "" THEN
								SELECT atypedesc FROM `tblappointmenttype` WHERE atypeid = v_atype_appointment_walker LIMIT 1 INTO v_project;
								SET v_categorization = 'Non-Productive';
								SET v_sort_categorization_counter = 2;
								SET v_sort_project_counter = 3;
							END IF;
							
							SELECT concat(v_sort_project_counter,'-',v_project) into v_project;
							
							
							INSERT INTO tbl_Results VALUES (
											v_engineer_id_appointment_walker
											,v_engineer_name_appointment_walker
											,v_categorization
											,v_project
											,v_startdatetime_cal
											,v_enddatetime_cal
											,v_startdatetime_appointment_walker
											,v_enddatetime_appointment_walker
											,v_hours
											,v_sort_categorization_counter
											,v_sort_project_counter);
							
							
							END IF;
							
						UNTIL bNestedInnerDone END REPEAT;
					CLOSE NestedInnercurs;
				END NestedInner;
				
				END IF;
				
			UNTIL bInnerDone END REPEAT;
		CLOSE Innercurs;
	END Nested;
	
	SELECT * FROM tbl_Results;
  
    END */$$
DELIMITER ;

