					DECLARE bNestedInnerDone INT;
					
					DECLARE NestedInnercurs CURSOR FOR 
					SELECT a.UserID, a.startdt, a.enddt, a.Project, a.refno, a.OperationalCat, a.atype
					FROM tblappointment a 
					WHERE ((a.startdt >= v_weekly_start_walker AND a.startdt <= v_weekly_end_walker) OR 
					(a.enddt >= v_weekly_start_walker AND a.enddt <= v_weekly_end_walker))
					AND (a.UserID = p_engineer OR p_engineer IS NULL OR p_engineer = "");
					
					DECLARE CONTINUE HANDLER FOR NOT FOUND SET bNestedInnerDone = 1;
					OPEN NestedInnercurs;
					SET bNestedInnerDone = 0;
						REPEAT
							FETCH NestedInnercurs INTO v_user_appointment_walker, v_startdatetime_appointment_walker, v_enddatetime_appointment_walker, 
										v_project_appointment_walker, v_refno_appointment_walker, v_operationalcat_appointment_walker, v_atype_appointment_walker;
								
							IF bNestedInnerDone IS FALSE THEN
							
							
							
														set v_hours = 0;
							if v_startdatetime_appointment_walker < v_weekly_start_walker and v_enddatetime_appointment_walker > ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY) THEN
								SELECT ifnull(TIMESTAMPDIFF(SECOND,v_weekly_start_walker,ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY))/3600,0) into v_hours;
								set v_startdatetime_cal = v_weekly_start_walker;
								set v_enddatetime_cal = ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY);
							ELSEIF v_startdatetime_appointment_walker < v_weekly_start_walker THEN
								SELECT IFNULL(TIMESTAMPDIFF(SECOND,v_weekly_start_walker,v_enddatetime_appointment_walker)/3600,0) INTO v_hours;
								SET v_startdatetime_cal = v_weekly_start_walker;
								SET v_enddatetime_cal = v_enddatetime_appointment_walker;
							ELSEIF v_enddatetime_appointment_walker > ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY) THEN
								SELECT IFNULL(TIMESTAMPDIFF(SECOND,v_startdatetime_appointment_walker,ADDDATE(v_weekly_end_walker, INTERVAL 1 DAY))/3600,0) INTO v_hours;
								SET v_startdatetime_cal = v_startdatetime_appointment_walker;
								SET v_enddatetime_cal = v_weekly_end_walker;
							ELSE
								SELECT IFNULL(TIMESTAMPDIFF(SECOND,v_startdatetime_appointment_walker,v_enddatetime_appointment_walker)/3600,0) INTO v_hours;
								SET v_startdatetime_cal = v_startdatetime_appointment_walker;
								SET v_enddatetime_cal = v_enddatetime_appointment_walker;
							END IF;
							
							
														set v_project = "";
							set v_categorization = "";
							
							if v_project_appointment_walker <> "" THEN
								SELECT ProjectName FROM `tblproject3d` WHERE ProjectID = v_project_appointment_walker LIMIT 1 INTO v_project;
								set v_categorization = 'Productive';
								set v_sort_categorization_counter = 1;
								SET v_sort_project_counter = 1;
							ELSEIF v_refno_appointment_walker <> "" THEN
								SET v_project = 'Incidents';
								SET v_categorization = 'Productive';
								SET v_sort_categorization_counter = 1;
								SET v_sort_project_counter = 2;
							ELSEIF v_operationalcat_appointment_walker <> "" THEN
								SELECT category_report FROM `tbloctier2` WHERE tierid = v_operationalcat_appointment_walker LIMIT 1 INTO v_categorization;
								if v_categorization = "Productive" THEN 
									SET v_project = 'Misc - Productive';
									SET v_sort_categorization_counter = 1;
								ELSEIF v_categorization = "Non-Productive" THEN
									SET v_project = 'Misc - Non Productive';
									SET v_sort_categorization_counter = 2;
								END IF;
								SET v_sort_project_counter = 4;
							ELSEIF v_atype_appointment_walker <> "" THEN
								SELECT atypedesc FROM `tblappointmenttype` WHERE atypeid = v_atype_appointment_walker LIMIT 1 INTO v_project;
								SET v_categorization = 'Non-Productive';
								SET v_sort_categorization_counter = 2;
								SET v_sort_project_counter = 3;
							END IF;
							
							SELECT concat(v_sort_project_counter,'-',v_project) into v_project;
							
							
							INSERT INTO tbl_Results VALUES (
																						concat("Week", v_weekly_counter)
											,v_categorization
											,v_project
											,v_startdatetime_cal
											,v_enddatetime_cal
											,v_startdatetime_appointment_walker
											,v_enddatetime_appointment_walker
											,v_hours
											,v_sort_categorization_counter
											,v_sort_project_counter
											,v_engineer);
							
							
							END IF;
							
						UNTIL bNestedInnerDone END REPEAT;
					CLOSE NestedInnercurs;
				END NestedInner;
				
				END IF;
				
			UNTIL bInnerDone END REPEAT;
		CLOSE Innercurs;
	END Nested;
	
	SELECT * FROM tbl_Results;
  
    END */$$
DELIMITER ;

